$1(a){return new A.f7("\ud30c\uc77c \uc790\ub3d9 \uc5c5\ub370\uc774\ud2b8","1.\ud30c\uc77c \uc120\ud0dd \ub2e4\uc774\uc5bc\ub85c\uadf8\n\ud504\ub85c\uadf8\ub7a8 \uc2e4\ud589 \uc2dc, \uc0ac\uc6a9\uc790\ub294 Ikemen_GO.exe(\uac8c\uc784) \ud30c\uc77c\uc744 \uc120\ud0dd\ud569\ub2c8\ub2e4. \uc774 \ud30c\uc77c\uc740 \uc5c5\ub370\uc774\ud2b8\ud560 \uac8c\uc784\uc758 \uc2e4\ud589 \ud30c\uc77c\uc785\ub2c8\ub2e4.\n\ud30c\uc77c \uc120\ud0dd \ub2e4\uc774\uc5bc\ub85c\uadf8\ub97c \ud1b5\ud574 \uc0ac\uc6a9\uc790\uac00 \ud30c\uc77c\uc744 \uc120\ud0dd\ud558\uba74, \uc120\ud0dd\ud55c \ud30c\uc77c\uc758 \ub514\ub809\ud1a0\ub9ac\uac00 \uc5c5\ub370\uc774\ud2b8\ud560 \ub300\uc0c1 \ud3f4\ub354\ub85c \uc124\uc815\ub429\ub2c8\ub2e4.\n\n2.\uc9c4\ud589\ub960 \ud45c\uc2dc \ubc0f \uc0c1\ud0dc \uba54\uc2dc\uc9c0\n\ud504\ub85c\uadf8\ub7a8\uc740 \uc9c4\ud589\ub960 \ud45c\uc2dc\uc904\uacfc \uc0c1\ud0dc \uba54\uc2dc\uc9c0 \ub77c\ubca8\uc744 \uc0ac\uc6a9\ud558\uc5ec \uc5c5\ub370\uc774\ud2b8 \uc9c4\ud589 \uc0c1\ud669\uc744 \uc2e4\uc2dc\uac04\uc73c\ub85c \uc0ac\uc6a9\uc790\uc5d0\uac8c \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\nprogress_var\uc640 status_var \ubcc0\uc218\ub97c \ud1b5\ud574 \uc9c4\ud589\ub960\uacfc \uc0c1\ud0dc \uba54\uc2dc\uc9c0\ub97c \uc5c5\ub370\uc774\ud2b8\ud569\ub2c8\ub2e4.\n\n3.\ud3f4\ub354 \uc0ad\uc81c\n\uc5c5\ub370\uc774\ud2b8\ub97c \uc2dc\uc791\ud558\uae30 \uc804\uc5d0, \ud504\ub85c\uadf8\ub7a8\uc740 \ud2b9\uc815 \ud3f4\ub354\ub97c \uc0ad\uc81c\ud569\ub2c8\ub2e4. \uc774\ub294 \uac8c\uc784\uc758 \ud2b9\uc815 \ub370\uc774\ud130 \ud3f4\ub354\ub97c \ucd08\uae30\ud654\ud558\uc5ec \uc0c8\ub85c\uc6b4 \ud30c\uc77c\ub85c \ub300\uccb4\ud558\uae30 \uc704\ud568\uc785\ub2c8\ub2e4.\n\uc0ad\uc81c\ud560 \ud3f4\ub354 \ubaa9\ub85d\uc5d0\ub294 'chars', 'data', 'font', 'sound', 'stages'\uac00 \ud3ec\ud568\ub429\ub2c8\ub2e4.\n\n4.\ud30c\uc77c \ub2e4\uc6b4\ub85c\ub4dc\n\uc5c5\ub370\uc774\ud2b8 \ud30c\uc77c\uc740 \uc778\ud130\ub137\uc5d0\uc11c \ub2e4\uc6b4\ub85c\ub4dc\ub429\ub2c8\ub2e4. \ud504\ub85c\uadf8\ub7a8\uc740 HTTP \uc694\uccad\uc744 \ud1b5\ud574 \uc9c0\uc815\ub41c URL\uc5d0\uc11c ZIP \ud30c\uc77c\uc744 \ub2e4\uc6b4\ub85c\ub4dc\ud569\ub2c8\ub2e4.\n\ub2e4\uc6b4\ub85c\ub4dc \uc9c4\ud589 \uc0c1\ud669\uc740 \ub2e4\uc6b4\ub85c\ub4dc\ub41c \ub370\uc774\ud130\uc758 \uc591\uc5d0 \ub530\ub77c \uc5c5\ub370\uc774\ud2b8\ub418\uba70, \ub2e4\uc6b4\ub85c\ub4dc\uac00 \uc644\ub8cc\ub418\uba74 \"\uc555\ucd95\ud574\uc81c\uc911...\"\uc774\ub77c\ub294 \uc0c1\ud0dc \uba54\uc2dc\uc9c0\uac00 \ud45c\uc2dc\ub429\ub2c8\ub2e4.\n\n5.\ud30c\uc77c \uc555\ucd95 \ud574\uc81c \ubc0f \uc815\ub9ac\n\ub2e4\uc6b4\ub85c\ub4dc\uac00 \uc644\ub8cc\ub41c ZIP \ud30c\uc77c\uc740 \uc9c0\uc815\ub41c \ub300\uc0c1 \ud3f4\ub354\ub85c \uc555\ucd95 \ud574\uc81c\ub429\ub2c8\ub2e4.\n\uc555\ucd95 \ud574\uc81c\uac00 \uc644\ub8cc\ub41c \ud6c4, ZIP \ud30c\uc77c\uc740 \uc0ad\uc81c\ub429\ub2c8\ub2e4.\n\uc555\ucd95 \ud574\uc81c\uac00 \uc644\ub8cc\ub418\uba74 \uc9c4\ud589\ub960\uc774 100%\ub85c \uc5c5\ub370\uc774\ud2b8\ub418\uace0, \uc644\ub8cc \ubc84\ud2bc\uc774 \ud45c\uc2dc\ub429\ub2c8\ub2e4.\n\n6.\uba40\ud2f0\uc2a4\ub808\ub529\n\ud30c\uc77c \ub2e4\uc6b4\ub85c\ub4dc\uc640 \uc555\ucd95 \ud574\uc81c\uc640 \uac19\uc740 \uc791\uc5c5\uc740 \ubcc4\ub3c4\uc758 \uc2a4\ub808\ub4dc\uc5d0\uc11c \uc2e4\ud589\ub429\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 GUI\uac00 \uc751\ub2f5\uc131\uc744 \uc720\uc9c0\ud558\ub3c4\ub85d \ud569\ub2c8\ub2e4.\nthreading.Thread\ub97c \uc0ac\uc6a9\ud558\uc5ec \uba54\uc778 \uc5c5\ub370\uc774\ud2b8 \uacfc\uc815\uc744 \ubcc4\ub3c4\uc758 \uc2a4\ub808\ub4dc\uc5d0\uc11c \uc2e4\ud589\ud569\ub2c8\ub2e4.\n\n7.GUI \uad6c\uc131\ntkinter \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc0ac\uc6a9\ud558\uc5ec GUI\ub97c \uad6c\uc131\ud569\ub2c8\ub2e4.\n\uc9c4\ud589\ub960 \ud45c\uc2dc\uc904\uacfc \uc0c1\ud0dc \uba54\uc2dc\uc9c0 \ub77c\ubca8\uc744 \uc124\uc815\ud558\uace0, 'Start' \ubc84\ud2bc\uc744 \ub20c\ub7ec \uc5c5\ub370\uc774\ud2b8\ub97c \uc2dc\uc791\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\uc5c5\ub370\uc774\ud2b8\uac00 \uc644\ub8cc\ub418\uba74 '\uc644\ub8cc' \ubc84\ud2bc\uc774 \ud45c\uc2dc\ub418\uba70, \uc774\ub97c \ub204\ub974\uba74 \ud504\ub85c\uadf8\ub7a8\uc774 \uc885\ub8cc\ub429\ub2c8\ub2e4.\n\n\ud504\ub85c\uadf8\ub7a8 \uc2e4\ud589 \ud750\ub984 \uc694\uc57d\n\ud504\ub85c\uadf8\ub7a8\uc744 \uc2e4\ud589\ud558\uba74 Ikemen_GO.exe \ud30c\uc77c\uc744 \uc120\ud0dd\ud558\ub294 \ub2e4\uc774\uc5bc\ub85c\uadf8\uac00 \ub098\ud0c0\ub0a9\ub2c8\ub2e4.\n\uc0ac\uc6a9\uc790\uac00 \ud30c\uc77c\uc744 \uc120\ud0dd\ud558\uba74, \uba54\uc778 \uc708\ub3c4\uc6b0\uac00 \ud45c\uc2dc\ub418\uace0 'Start' \ubc84\ud2bc\uc774 \ub098\ud0c0\ub0a9\ub2c8\ub2e4.\n\uc0ac\uc6a9\uc790\uac00 'Start' \ubc84\ud2bc\uc744 \ub204\ub974\uba74, \uc5c5\ub370\uc774\ud2b8 \uc791\uc5c5\uc774 \ubcc4\ub3c4\uc758 \uc2a4\ub808\ub4dc\uc5d0\uc11c \uc2dc\uc791\ub429\ub2c8\ub2e4.\n\ud504\ub85c\uadf8\ub7a8\uc740 \ud2b9\uc815 \ud3f4\ub354\ub97c \uc0ad\uc81c\ud558\uace0, \uc5c5\ub370\uc774\ud2b8 \ud30c\uc77c\uc744 \ub2e4\uc6b4\ub85c\ub4dc\ud55c \ud6c4, \uc555\ucd95\uc744 \ud574\uc81c\ud569\ub2c8\ub2e4.\n\uc9c4\ud589\ub960 \ud45c\uc2dc\uc904\uacfc \uc0c1\ud0dc \uba54\uc2dc\uc9c0 \ub77c\ubca8\uc774 \uc2e4\uc2dc\uac04\uc73c\ub85c \uc5c5\ub370\uc774\ud2b8 \uc9c4\ud589 \uc0c1\ud669\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\n\uc5c5\ub370\uc774\ud2b8\uac00 \uc644\ub8cc\ub418\uba74 '\uc644\ub8cc' \ubc84\ud2bc\uc774 \ub098\ud0c0\ub098\uace0, \uc0ac\uc6a9\uc790\uac00 \uc774\ub97c \ub204\ub974\uba74 \ud504\ub85c\uadf8\ub7a8\uc774 \uc885\ub8cc\ub429\ub2c8\ub2e4.\n\uc774 \ud504\ub85c\uadf8\ub7a8\uc740 \uc0ac\uc6a9\uc790\uac00 \uac04\ud3b8\ud558\uac8c \uac8c\uc784 \ud30c\uc77c\uc744 \ucd5c\uc2e0 \uc0c1\ud0dc\ub85c \uc720\uc9c0\ud560 \uc218 \uc788\ub3c4\ub85d \ub3d5\uc2b5\ub2c8\ub2e4.","\uce5c\uad6c\ub4e4\uacfc \uac8c\uc784\ud560 \ub54c \ud574\ub2f9 \uac8c\uc784\uc758 \uacbd\uc6b0 \uc218\ub3d9\uc73c\ub85c \uce90\ub9ad\ud130\ub97c \ub450 \ud50c\ub808\uc774\uc5b4 \ubaa8\ub450 \uc5c5\ub370\uc774\ud2b8 \ud574\uc918\uc57c\ud574\uc11c \uce5c\uad6c\ub4e4\uc774 \ubd88\ud3b8\ud568\uc744 \ud638\uc18c\ud558\uc5ec \uc81c\uc791\uc744 \uc2dc\uc791\ud558\uc600\ub2e4. \ud30c\uc774\uc36c\uc73c\ub85c \uad6c\uae00\ub4dc\ub77c\uc774\ube0c\uc5d0 \uc811\uc18d\ud558\ub294 \ubd80\ubd84\uc5d0\uc11c \uacfc\uac70\uc758 \uae00\uacfc \ub2e4\ub974\uac8c \ucd94\uac00\uc801\uc778 \uc791\uc5c5\uc774 \ud544\uc694\ud558\uc5ec \ud574\ub2f9 \ubd80\ubd84\uc744 \ucc3e\uc544\ub0b4\ub294\uac8c \uc5b4\ub824\uc6e0\ub2e4.",null)},
